import "./UserModal.css";

const UserModal = ({ userInfo }) => {
  const showUserInfo = () => {
    const infoContainer = Object.entries(userInfo);
    return infoContainer.map(([key, value]) => {
      console.log(key, value);
      return (
        <div key={key}>
          {key}: {value}
        </div>
      );
    });
  };
  return (
    <div className="modal">
      <div className="modal__body">{showUserInfo()}</div>
    </div>
  );
};

export default UserModal;
